import { Component, OnInit } from '@angular/core';
import { Flight } from '../flight';
import {FlightListComponent} from '../flight-list/flight-list.component'


@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit{
  flight = new Flight();

  title="BrownField Airline";

  constructor(){

  }
  ngOnInit(): void {

  }
  onSubmit(){
    console.log(this.flight);
  }

}
<form>
    <form (ngSubmit) = "onSubmit()">

        <div class="form-group">
            <label> Origin</label>
            <input type="text" class ="form-control" id = "origin"
                [(ngModel)] = "flight.origin" name = "origin">
        </div>

        <div class="form-group">
            <label> Destination</label>
            <input type="text" class ="form-control" id = "Destination"
                [(ngModel)] = "flight.destination" name = "Destination">
        </div>
        <div class="form-group">
            <label> Flight Date</label>
            <input type="text" class ="form-control" id = "flightDate"
                [(ngModel)] = "flight.flightDate" name = "flightDate">
        </div>

        <button class = "btn btn-success" type ="search">Search</button>
</form>

<app-flight-list></app-flight-list>
